export function Banner() {
  return (
    <Box className="flex py-12">
      <div>
        <h1 className="scroll-m-20 text-4xl font-extrabold tracking-tight lg:text-5xl">
          RLHF APP
        </h1>
        <p className="leading-7 [&:not(:first-child)]:mt-6 max-w-2xl">
          Open-source platform for fine-tuning LLMs in low-resource languages
          that creates workflows for supervised fine-tuning, preference tuning
          (RLHF and more), and scalable evaluation.
        </p>
        <CardLogin />
      </div>

      <Gallery />
    </Box>
  );
}

